pub enum DiffItem<'a, A> {
    Add(&'a A),
    Update {
        old: &'a A,
        new: &'a A,
    },
    Remove(&'a A),
}

pub enum Entry<'a, K, V> where K: Ord + Clone, V: Clone {
    Occupied(OccupiedEntry),
    Vacant(VacantEntry),
}

pub enum DiffItem<'a, K, V> {
    Add(&'a K, &'a V),
    Update {
        old: (&'a K, &'a V),
        new: (&'a K, &'a V),
    },
    Remove(&'a K, &'a V),
}

pub enum Entry<'a, K, V, S> where K: Hash + Eq + Clone, V: Clone,
         S: BuildHasher {
    Occupied(OccupiedEntry),
    Vacant(VacantEntry),
}

pub enum FocusMut<'a, A> {
    Single(RRBPool<A>, &'a mut [A]),
    Full(RRBPool<A>, TreeFocusMut),
}
